def save_response_html(resp, filepath="bhulekh_response.html", open_in_browser=False):
	"""Save response.text to an HTML file. Optionally open in default browser."""
	text = resp.text if resp is not None else ""
	# Write the HTML to file (UTF-8)
	with open(filepath, "w", encoding="utf-8") as fh:
		fh.write(text)
	print(f"Saved response to: {filepath}")

	if open_in_browser:
		try:
			import webbrowser

			webbrowser.open_new_tab(filepath)
			print("Opened in default browser.")
		except Exception as e:
			print("Could not open browser:", e)


